import React from "react";

function Home1() {
  return (
    <div className="home1">
      <iframe
        src="https://www.youtube.com/embed/yYuzVLRf59Q"
        frameborder="0"
        allow="autoplay"
        allowfullscreen
      ></iframe>
      {/* <iframe
        src={`"https://www.youtube.com/embed/yYuzVLRf59Q"?autoplay=1&mute=1&controls=0`}
        allow="autoplay"
        allowFullScreen
      ></iframe> */}
      <h1>Home</h1>
      <p>
        Lorem ipsum dolor sit, amet consectetur adipisicing elit. Quis
        voluptatum quos unde asperiores ipsum cupiditate deserunt et veritatis,
        tenetur officiis aliquam repudiandae recusandae nisi, nemo ipsa sit cum
        explicabo ducimus.
      </p>
    </div>
  );
}

export default Home1;
